import React, { Component } from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));

function App() {
  return (
    <div className="App">
      <h1>Heyya</h1>
    </div>
  );
}

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
